import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Monitoring = () => {
  const [monitoring, setMonitoring] = useState([]);
  const [performance, setPerformance] = useState({
    test1: '',
    midterm: '',
    assignment: '',
    finalExam: '',
    attendance: '',
    timetable: '',
    results: '',
    upcomingTests: ''
  });
  const token = localStorage.getItem('token');
  const headers = { Authorization: `Bearer ${token}` };

  // Fetch monitoring logs
  useEffect(() => {
    axios.get('/api/monitoring', { headers })
      .then(res => setMonitoring(res.data))
      .catch(err => alert('Failed to fetch monitoring logs'));
  }, []);

  // Handle input change for performance form
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setPerformance(prev => ({ ...prev, [name]: value }));
  };

  // Submit student performance data
  const handlePerformanceSubmit = () => {
    // You should replace this URL with your API endpoint
    axios.post('/api/student/performance', performance, { headers })
      .then(res => {
        alert('Performance data saved successfully');
        // Optionally, refresh or update the performance data
      })
      .catch(err => alert('Failed to save performance data'));
  };

  return (
    <div className="container mt-5">
      <h3>Monitoring Logs</h3>
      <table className="table">
        <thead>
          <tr>
            <th>Action</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {monitoring.map(log => (
            <tr key={log.id}>
              <td>{log.action}</td>
              <td>{log.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Student Performance Monitoring Section */}
      <h3 className="mt-5">Student Performance Monitoring</h3>
      <div className="card p-3 mb-4">
        <h5>Enter Your Performance Data</h5>
        <div className="row mb-2">
          <div className="col">
            <label>Test 1 Marks:</label>
            <input
              type="number"
              className="form-control"
              name="test1"
              value={performance.test1}
              onChange={handleInputChange}
            />
          </div>
          <div className="col">
            <label>Midterm Marks:</label>
            <input
              type="number"
              className="form-control"
              name="midterm"
              value={performance.midterm}
              onChange={handleInputChange}
            />
          </div>
        </div>
        <div className="row mb-2">
          <div className="col">
            <label>Assignment Marks:</label>
            <input
              type="number"
              className="form-control"
              name="assignment"
              value={performance.assignment}
              onChange={handleInputChange}
            />
          </div>
          <div className="col">
            <label>Final Exam Marks:</label>
            <input
              type="number"
              className="form-control"
              name="finalExam"
              value={performance.finalExam}
              onChange={handleInputChange}
            />
          </div>
        </div>
        <div className="mb-2">
          <label>Attendance (%):</label>
          <input
            type="number"
            className="form-control"
            name="attendance"
            value={performance.attendance}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-2">
          <label>Timetable:</label>
          <input
            type="text"
            className="form-control"
            name="timetable"
            value={performance.timetable}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-2">
          <label>Results:</label>
          <textarea
            className="form-control"
            name="results"
            value={performance.results}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-2">
          <label>Upcoming Tests:</label>
          <textarea
            className="form-control"
            name="upcomingTests"
            value={performance.upcomingTests}
            onChange={handleInputChange}
          />
        </div>
        <button className="btn btn-primary" onClick={handlePerformanceSubmit}>Save Performance Data</button>
      </div>
    </div>
  );
};

export default Monitoring;
